import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import { useParams } from "react-router-dom";
import Header from "../header/Header";
import "../App.css";
import "./ProjectPage.css";
import logo from "../../public/hybris-logo.jpeg";

function ProjectPage() {
  const { id } = useParams();

  // Use the id in your component logic

  return (
    <>
      <Container fluid>
        <Row className="top-screen parent-row">
          <Col xs={2} className="blue-background">
            {/* Left Section */}
          </Col>
          <Col
            xs={8}
            className="image-column blue-background "
            style={{ overflow: "hidden" }}
          >
            <Header />
            <img src={logo} alt="Logo" />;
          </Col>

          <Col xs={2} className="blue-background">
            {/* Right Section */}
          </Col>
        </Row>

        <Row className="lower-screen parent-row">
          <Col xs={2} className="blue-background">
            {/* Left Section */}
          </Col>
          <Col xs={8} className="blue-background">
            <div className="work-gallery">Work gallery</div>
          </Col>
          <Col xs={2} className="blue-background">
            {/* Right Section */}
          </Col>
        </Row>
      </Container>
    </>
  );
}

export default ProjectPage;
